webpackJsonp([87984366238641],{682:function(A,e){A.exports={data:{markdownRemark:{headings:[],html:'<p><em>Easel</em> is a mobile art therapy application that helps users improve their mental and emotional well-being. According to studies, visual art can be used as a cathartic tool for releasing difficult emotions and improving mental health. It also boosts emotional intelligence by facilitating self-reflection and encouraging users to understand themselves better. Art therapy is conducted in person between a client and a therapist. However, sessions are often expensive, underfunded by the government and difficult to access.</p>\n<p>I believe in the value of art therapy and wish more people could reap its benefits, especially those with mental illness who cannot afford it. My solution is to create a free-to-download app that turns art therapy into a form of self-help. Using guided art therapy sessions and integrated drawing tools, users can help themselves anywhere, anytime. Easel is designed to bring art therapy to everyone.</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 500px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 69.13793103448276%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="null"\n        title=""\n        src="/static/easel_2-14caec3074066354d620c97848cbabd5-755ae.jpg"\n        srcset="/static/easel_2-14caec3074066354d620c97848cbabd5-f07fc.jpg 125w,\n/static/easel_2-14caec3074066354d620c97848cbabd5-9d06f.jpg 250w,\n/static/easel_2-14caec3074066354d620c97848cbabd5-755ae.jpg 500w,\n/static/easel_2-14caec3074066354d620c97848cbabd5-63ca3.jpg 750w,\n/static/easel_2-14caec3074066354d620c97848cbabd5-9b9a3.jpg 1000w,\n/static/easel_2-14caec3074066354d620c97848cbabd5-6e031.jpg 1500w,\n/static/easel_2-14caec3074066354d620c97848cbabd5-4f538.jpg 2900w"\n        sizes="(max-width: 500px) 100vw, 500px"\n      />\n    </span>\n  </span>\n  </p>',frontmatter:{title:"Easel: Art Therapy for Everyone",graduate:"Elizabeth Zhu",category:"UI/UX",category2:"Product Design",category3:null,image:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.5,src:"/static/easel_1-c601f28f14b2cc85db659dbe8fca4682-a7a62.jpg",srcSet:"/static/easel_1-c601f28f14b2cc85db659dbe8fca4682-5a1a9.jpg 375w,\n/static/easel_1-c601f28f14b2cc85db659dbe8fca4682-0908c.jpg 750w,\n/static/easel_1-c601f28f14b2cc85db659dbe8fca4682-a7a62.jpg 1500w,\n/static/easel_1-c601f28f14b2cc85db659dbe8fca4682-83d7d.jpg 2000w",sizes:"(max-width: 1500px) 100vw, 1500px"}}}}}},pathContext:{slug:"/work/easel-art-therapy-for-everyone/",name:"/Easel: Art Therapy for Everyone/"}}}});
